import React from 'react';
import './App.css';
import root from './index.js';

function Profile() {
    return (
        <div className="Profile">
            <p>Ваш профиль</p>
            <p>Поиск людей</p>
            <p>Друзья</p>
            <p>Чаты</p>
            <p>Выйти</p>
        </div>
    );
}

export default function setProfile() {
    root.render(<Profile />)
}
